import React, { useState } from 'react';
import './DoctorDetail.css';

const DoctorDetail = () => {
  const [doctorInfo] = useState({
    fullName: 'Dr. Emily Nguyen',
    idCard: '123456789',
    gender: 'Female',
    dob: '1990-01-01',
    phoneNumber: '1234567890',
    email: 'emilynguyen@example.com',
    address: '123 Street, City',
    diploma: 'Bằng cấp nha khoa - Trường Đại học Y Dược',
    experience: '5 years',
  });

  const avatarUrl = 'https://via.placeholder.com/150'; // Thay bằng URL ảnh avatar từ nguồn dữ liệu của bạn

  const handleEdit = () => {
    // Xử lý sự kiện chỉnh sửa thông tin
    console.log('Chỉnh sửa thông tin bác sĩ');
  };

  return (
    <div className="doctor-detail">
      <div className="doctor-avatar">
        <img src={avatarUrl} alt="Doctor Avatar" className="avatar" />
      </div>
      <div className="doctor-info">
        <h2 className="doctor-name">{doctorInfo.fullName}</h2>
        <p>ID Card: {doctorInfo.idCard}</p>
        <p>Gender: {doctorInfo.gender}</p>
        <p>Date of Birth: {doctorInfo.dob}</p>
        <p>Phone Number: {doctorInfo.phoneNumber}</p>
        <p>Email: {doctorInfo.email}</p>
        <p>Address: {doctorInfo.address}</p>
        <p>Diploma: {doctorInfo.diploma}</p>
        <p>Experience: {doctorInfo.experience}</p>
      </div>
      <button className="edit-button" onClick={handleEdit}>
        Chỉnh Sửa Thông Tin
      </button>
    </div>
  );
};

export default DoctorDetail;
